am5.ready(function() {
    // Create root element
    // https://www.amcharts.com/docs/v5/getting-started/#Root_element
    var root = am5.Root.new("chartdiv");
    // Set themes
    // https://www.amcharts.com/docs/v5/concepts/themes/
    root.setThemes([
        am5themes_Animated.new(root)
    ]);
    // Create chart
    // https://www.amcharts.com/docs/v5/charts/percent-charts/pie-chart/
    var chart = root.container.children.push(am5percent.PieChart.new(root, {
        layout: root.verticalLayout,
        innerRadius: am5.percent(50)
    }));
    // Create series
    // https://www.amcharts.com/docs/v5/charts/percent-charts/pie-chart/#Series
    var series = chart.series.push(am5percent.PieSeries.new(root, {
        valueField: "value",
        categoryField: "category",
        alignLabels: false
    }));
    series.labels.template.setAll({
        textType: "circular",
        centerX: 0,
        centerY: 0
    });
    // Set data
    // https://www.amcharts.com/docs/v5/charts/percent-charts/pie-chart/#Setting_data
    series.data.setAll([
        {
            value: 10,
            category: "One"
        },
        {
            value: 9,
            category: "Two"
        },
        {
            value: 6,
            category: "Three"
        },
        {
            value: 5,
            category: "Four"
        },
        {
            value: 4,
            category: "Five"
        },
        {
            value: 3,
            category: "Six"
        },
        {
            value: 1,
            category: "Seven"
        }
    ]);
    // Create legend
    // https://www.amcharts.com/docs/v5/charts/percent-charts/legend-percent-series/
    var legend = chart.children.push(am5.Legend.new(root, {
        centerX: am5.percent(50),
        x: am5.percent(50),
        marginTop: 15,
        marginBottom: 15
    }));
    legend.data.setAll(series.dataItems);
    // Play initial series animation
    // https://www.amcharts.com/docs/v5/concepts/animations/#Animation_of_series
    series.appear(1000, 100);
}); // end am5.ready()
function loading(type) {
    let loader = document.getElementById('loader');
    let loadingText = document.getElementById('loading-text');
    let general = document.getElementById('general');
    let technical = document.getElementById('technical');
    general.style.display = 'none';
    technical.style.display = 'none';
    general.style.opacity = '0';
    technical.style.opacity = '0';
    loader.style.display = 'block';
    loadingText.style.display = 'block'; // Show loading message
    // Force reflow to apply display change
    loader.offsetHeight;
    setTimeout(()=>{
        loader.style.display = 'none';
        loadingText.style.display = 'none'; // Hide message when image appears
        const img1 = document.getElementById(type);
        img1.style.display = 'block';
        // Slight delay to ensure display change registers
        setTimeout(()=>{
            img1.style.opacity = '1';
        }, 50);
    }, 2000);
}
